INSERT INTO "avis" (idavis, idproduit,idclient, dateavis, descriptionavis, noteavis ) VALUES (1,2,2,'11/05/2021' ,'Idéal bureautique ! Utilisé essentiellement pour des travaux de bureautique et pour la navigation sur Internet.',7);
INSERT INTO "avis" (idavis, idproduit,idclient, dateavis, descriptionavis, noteavis ) VALUES (2,8,45,'15/03/2021' ,'Enfin ! Depuis le temps que je devais changer de boitier canon...Le passage dun 7D à un 5d mark IV vous fait changer dunivers, maintenant, au vu des possibilités de la bête, il ny a plus quà lapprivoiser ! Après le prix est bien trop élevé mais avec les offres Fnac couplées aux offres Canon, 800 € de moins !',9);
INSERT INTO "avis" (idavis, idproduit,idclient, dateavis, descriptionavis, noteavis ) VALUES (3,11,54,'16/05/2021' ,'Excellente! Rien à redire, un son magnifique et puissant même pour une pièce de 100m2!',8);
INSERT INTO "avis" (idavis, idproduit,idclient, dateavis, descriptionavis, noteavis ) VALUES (4,13,98,'02/05/2021' ,'Top ! Rapport qualité prix imbattable.',10);
INSERT INTO "avis" (idavis, idproduit,idclient, dateavis, descriptionavis, noteavis ) VALUES (5,4,8,'04/05/2021' ,'Mauvais son appel ! A première vue, jétais très satisfaite du produit, de petite taille, fonctionnel avec un très belle qualité photo due au logiciel de retouche. Mais après quelques jours, écho important lors des appels, insupportable sans écouteurs. Jai fait quelques recherches et à priori cest un problème récurent avec les portables Google. Service après vente en cours, à suivre... Mais au prix du téléphone, cest très décevant.',3);
